import React from 'react'
import ReactDOM from 'react-dom'
const fname= "Tanu";
const lname="Pahadi";
var d = new Date();
ReactDOM.render(
  <>
  <h1>{`Hello my name is ${fname} ${lname} `}</h1>
  <p>todays Date is= {d.toLocaleDateString()}  </p>
  <p>todays Time is=  {d.toLocaleTimeString()}  </p>

  </>,
  document.getElementById('root'));
